// TestSQL.jsx
import React, { useState } from 'react';

function TestSQL() {
    const [resultado, setResultado] = useState(null);
    const [loading, setLoading] = useState(false);

    const probar = async () => {
        setLoading(true);
        setResultado(null);

        // URL con puerto 3001
        const url = 'http://localhost:8080/test-sql.php';

        console.log('üîó Conectando a:', url);

        try {
            const res = await fetch(url, {
                method: 'GET',
                headers: {
                    'Content-Type': 'application/json'
                }
            });

            console.log('üì° Respuesta HTTP:', res.status);

            if (!res.ok) {
                throw new Error(`Error HTTP: ${res.status}`);
            }

            const data = await res.json();
            console.log('‚úÖ Datos recibidos:', data);
            setResultado(data);

        } catch (err) {
            console.error('‚ùå Error:', err);
            setResultado({
                success: false,
                error: err.message,
                url: url
            });
        } finally {
            setLoading(false);
        }
    };

    return (
        <div style={{
            padding: '30px',
            fontFamily: 'Arial, sans-serif',
            maxWidth: '800px',
            margin: '0 auto'
        }}>
            <h2>üß™ Test Conexi√≥n SQL Server</h2>
            <p style={{ color: '#666' }}>
                Servidor: <strong>DE250329\SQLEXPRESS</strong><br />
                Puerto PHP: <strong>3001</strong>
            </p>

            <button
                onClick={probar}
                disabled={loading}
                style={{
                    padding: '15px 40px',
                    fontSize: '18px',
                    backgroundColor: loading ? '#ccc' : '#4CAF50',
                    color: 'white',
                    border: 'none',
                    borderRadius: '5px',
                    cursor: loading ? 'not-allowed' : 'pointer',
                    fontWeight: 'bold'
                }}
            >
                {loading ? '‚è≥ Probando...' : 'üöÄ Probar Conexi√≥n'}
            </button>

            {loading && (
                <div style={{
                    marginTop: '20px',
                    padding: '15px',
                    backgroundColor: '#f0f0f0',
                    borderRadius: '5px'
                }}>
                    <p>‚è≥ Conectando a http://localhost:3001/test-sql.php ...</p>
                </div>
            )}

            {resultado && (
                <div style={{
                    marginTop: '20px',
                    padding: '20px',
                    backgroundColor: resultado.success ? '#d4edda' : '#f8d7da',
                    border: `3px solid ${resultado.success ? '#28a745' : '#dc3545'}`,
                    borderRadius: '8px'
                }}>
                    <h3 style={{ margin: '0 0 10px 0' }}>
                        {resultado.success ? '‚úÖ √âXITO' : '‚ùå ERROR'}
                    </h3>

                    <p style={{ fontSize: '16px', margin: '10px 0' }}>
                        <strong>Mensaje:</strong> {resultado.mensaje || resultado.error}
                    </p>

                    {resultado.servidor && (
                        <p style={{ fontSize: '14px', color: '#555' }}>
                            <strong>Servidor:</strong> {resultado.servidor}
                        </p>
                    )}

                    {resultado.url && (
                        <p style={{ fontSize: '14px', color: '#555' }}>
                            <strong>URL intentada:</strong> {resultado.url}
                        </p>
                    )}

                    {resultado.datos && resultado.datos.length > 0 && (
                        <div style={{ marginTop: '15px' }}>
                            <strong>üìä Datos obtenidos ({resultado.datos.length} registros):</strong>
                            <div style={{
                                backgroundColor: '#f5f5f5',
                                padding: '15px',
                                borderRadius: '5px',
                                marginTop: '10px',
                                overflow: 'auto',
                                maxHeight: '400px'
                            }}>
                                <table style={{
                                    width: '100%',
                                    borderCollapse: 'collapse',
                                    fontSize: '14px'
                                }}>
                                    <thead>
                                        <tr style={{ backgroundColor: '#333', color: 'white' }}>
                                            <th style={{ padding: '10px', textAlign: 'left' }}>PBL</th>
                                            <th style={{ padding: '10px', textAlign: 'left' }}>Estaci√≥n</th>
                                            <th style={{ padding: '10px', textAlign: 'left' }}>Producto</th>
                                            <th style={{ padding: '10px', textAlign: 'right' }}>Precio</th>
                                        </tr>
                                    </thead>
                                    <tbody>
                                        {resultado.datos.map((item, index) => (
                                            <tr key={index} style={{
                                                backgroundColor: index % 2 === 0 ? 'white' : '#f9f9f9',
                                                borderBottom: '1px solid #ddd'
                                            }}>
                                                <td style={{ padding: '8px' }}>{item.Pbl}</td>
                                                <td style={{ padding: '8px' }}>{item.Nombre_EESS}</td>
                                                <td style={{ padding: '8px' }}>{item.Producto}</td>
                                                <td style={{ padding: '8px', textAlign: 'right' }}>
                                                    ${item.Precio_Venta}
                                                </td>
                                            </tr>
                                        ))}
                                    </tbody>
                                </table>
                            </div>
                        </div>
                    )}
                </div>
            )}
        </div>
    );
}

export default TestSQL;
